import React from 'react'
import {  useSelector } from "react-redux";


function Profile(){
    const users = useSelector(st=>st.userData.arr)
    console.log(users)


    return(
        <div className='profileBg'>
         <h1>Profile</h1>
         <h1>{users.name}</h1>
        </div>
    )
}

export default Profile;
